INSERT INTO `observations` VALUES (1,8,'I know I am a unique individual and can tell you what I am like.','sa1','Self Awareness - I know I am a unique individual and can tell you what I am like.',10,'2019-03-01 17:54:24','2019-03-01 17:54:24'),(2,8,'I know my strengths and I feel good about them.','sa2','Self Awareness - I know my strengths and I feel good about them.',20,'2019-03-01 17:54:24','2019-03-01 17:54:24'),(3,8,'I know the things I find hard and I can try to get better at them.','sa3','Self Awareness - I know the things I find hard and I can try to get better at them.',30,'2019-03-01 17:54:24','2019-03-01 17:54:24'),(4,8,'I can tell when I feel proud of myself and I like it when others praise me.','sa4','Self Awareness - I can tell when I feel proud of myself and I like it when others praise me.',40,'2019-03-01 17:54:24','2019-03-01 17:54:24'),(5,8,'I know what is important to me and can listen to what other people want from me.','sa5','Self Awareness - I know what is important to me and can listen to what other people want from me.',50,'2019-03-01 17:54:24','2019-03-01 17:54:24'),(6,8,'I can think about my actions and can learn from them.','sa6','Self Awareness - I can think about my actions and can learn from them.',60,'2019-03-01 17:54:24','2019-03-01 17:54:24'),(7,8,'I can make sense of what has happened to me and understand how this makes me feel.','sa7','Self Awareness - I can make sense of what has happened to me and understand how this makes me feel.',70,'2019-03-01 17:54:24','2019-03-01 17:54:24'),(8,8,'I can tell what I am feeling and can say how I am feeling.','sa8','Self Awareness - I can tell what I am feeling and can say how I am feeling.',80,'2019-03-01 17:54:24','2019-03-01 17:54:24'),(9,8,'I know that feelings sometimes \'take over\' and know what makes me feel angry or upset.','sa9','Self Awareness - I know that feelings sometimes \'take over\' and know what makes me feel angry or upset.',90,'2019-03-01 17:54:24','2019-03-01 17:54:24'),(1