nformity\",\"description\":\"Description for Classroom Conformity\",\"colour\":\"#77B28C\",\"order\":70,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"}],\"observations\":[{\"id\":1,\"area_id\":8,\"name\":\"I know I am a unique individual and can tell you what I am like.\",\"key\":\"sa1\",\"description\":\"Self Awareness - I know I am a unique individual and can tell you what I am like.\",\"order\":10,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":2,\"area_id\":8,\"name\":\"I know my strengths and I feel good about them.\",\"key\":\"sa2\",\"description\":\"Self Awareness - I know my strengths and I feel good about them.\",\"order\":20,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":3,\"area_id\":8,\"name\":\"I know the things I find hard and I can try to get better at them.\",\"key\":\"sa3\",\"description\":\"Self Awareness - I know the things I find hard and I can try to get better at them.\",\"order\":30,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":4,\"area_id\":8,\"name\":\"I can tell when I feel proud of myself and I like it when others praise me.\",\"key\":\"sa4\",\"description\":\"Self Awareness - I can tell when I feel proud of myself and I like it when others praise me.\",\"order\":40,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":5,\"area_id\":8,\"name\":\"I know what is important to me and can listen to what other people want from me.\",\"key\":\"sa5\",\"description\":\"Self Awareness - I know what is important to me and can listen to what other people want from me.\",\"order\":50,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":6,\"area_id\":8,\"name\":\"I can think about my actions and can learn from them.\",\"key\":\"sa6\",\"description\":\"Self Awareness - I can think about my actions and can learn from them.\",\"order\":60,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":7,\"area_id\":8,\"name\":\"I can make sense of what has happened to me and understand how this makes me feel.\",\"key\":\"sa7\",\"description\":\"Self Awareness - I can make sense of what has happened to me and understand how this makes me feel.\",\"order\":70,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":8,\"area_id\":8,\"name\":\"I can tell what I am feeling and can say how I am feeling.\",\"key\":\"sa8\",\"description\":\"Self Awareness - I can tell what I am feeling and can say how I am feeling.\",\"order\":80,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":9,\"area_id\":8,\"name\":\"I know that feelings sometimes \'take over\' and know what makes me feel angry or upset.\",\"key\":\"sa9\",\"description\":\"Self Awareness - I know that feelings sometimes \'take over\' and know what makes me feel angry or upset.\",\"order\":90,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":10,\"area_id\":8,\"name\":\"I can tell how I am likely to think, feel and behave in different situations.\",\"key\":\"sa10\",\"description\":\"Self Awareness - I can tell how I am likely to think, feel and behave in different situations.\",\"order\":100,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":11,\"area_id\":8,\"name\":\"I can tell when I have conflicting feelings and know how to cope with this.\",\"key\":\"sa11\",\"description\":\"Self Awareness - I can tell when I have conflicting feelings and know how to cope with this.\",\"order\":110,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":12,\"area_id\":8,\"name\":\"I can use my past experience to make wise choices to plan what to do with learning and relationships.\",\"key\":\"sa12\",\"description\":\"Self Awareness - I can use my past experience to make wise choices to plan what to do with learning and relationships.\",\"order\":120,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":13,\"area_id\":9,\"name\":\"I can express my feelings clearly and openly and appropriately in different situations.\",\"key\":\"mf13\",\"description\":\"Managing Feelings - I can express my feelings clearly and openly and appropriately in different situations.\",\"order\":10,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":14,\"area_id\":9,\"name\":\"I know that how I express my feelings makes a difference to other people and what happens to me.\",\"key\":\"mf14\",\"description\":\"Managing Feelings - I know that how I express my feelings makes a difference to other people and what happens to me.\",\"order\":20,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":15,\"area_id\":9,\"name\":\"I know some ways to manage strong feelings so that I do not hurt myself and other people.\",\"key\":\"mf15\",\"description\":\"Managing Feelings - I know some ways to manage strong feelings so that I do not hurt myself and other people.\",\"order\":30,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":16,\"area_id\":9,\"name\":\"I know what makes me feel good and how to help have a good time in ways that don\'t hurt myself or other people.\",\"key\":\"mf16\",\"description\":\"Managing Feelings - I know what makes me feel good and how to help have a good time in ways that don\'t hurt myself or other people.\",\"order\":40,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":17,\"area_id\":9,\"name\":\"I know that how I feel makes a difference to my health and know how to keep myself well and happy.\",\"key\":\"mf17\",\"description\":\"Managing Feelings - I know that how I feel makes a difference to my health and know how to keep myself well and happy.\",\"order\":50,\"created_at\":\"20