896\",\"order\":50,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":13,\"name\":\"Task Orientation\",\"description\":\"Description for Task Orientation\",\"colour\":\"#8D89A6\",\"order\":60,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":14,\"name\":\"Classroom Conformity\",\"description\":\"Description for Classroom Conformity\",\"colour\":\"#77B28C\",\"order\":70,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"}],\"observations\":[{\"id\":1,\"area_id\":8,\"name\":\"I know I am a unique individual and can tell you what I am like.\",\"key\":\"sa1\",\"description\":\"Self Awareness - I know I am a unique individual and can tell you what I am like.\",\"order\":10,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":2,\"area_id\":8,\"name\":\"I know my strengths and I feel good about them.\",\"key\":\"sa2\",\"description\":\"Self Awareness - I know my strengths and I feel good about them.\",\"order\":20,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":3,\"area_id\":8,\"name\":\"I know the things I find hard and I can try to get better at them.\",\"key\":\"sa3\",\"description\":\"Self Awareness - I know the things I find hard and I can try to get better at them.\",\"order\":30,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":4,\"area_id\":8,\"name\":\"I can tell when I feel proud of myself and I like it when others praise me.\",\"key\":\"sa4\",\"description\":\"Self Awareness - I can tell when I feel proud of myself and I like it when others praise me.\",\"order\":40,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":5,\"area_id\":8,\"name\":\"I know what is important to me and can listen to what other people want from me.\",\"key\":\"sa5\",\"description\":\"Self Awareness - I know what is important to me and can listen to what other people want from me.\",\"order\":50,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":6,\"area_id\":8,\"name\":\"I can think about my actions and can learn from them.\",\"key\":\"sa6\",\"description\":\"Self Awareness - I can think about my actions and can learn from them.\",\"order\":60,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":7,\"area_id\":8,\"name\":\"I can make sense of what has happened to me and understand how this makes me feel.\",\"key\":\"sa7\",\"description\":\"Self Awareness - I can make sense of what has happened to me and understand how this makes me feel.\",\"order\":70,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":8,\"area_id\":8,\"name\":\"I can tell what I am feeling and can say how I am feeling.\",\"key\":\"sa8\",\"description\":\"Self Awareness - I can tell what I am feeling and can say how I am feeling.\",\"order\":80,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":9,\"area_id\":8,\"name\":\"I know that feelings sometimes \'take over\' and know what makes me feel angry or upset.\",\"key\":\"sa9\",\"description\":\"Self Awareness - I know that feelings sometimes \'take over\' and know what makes me feel angry or upset.\",\"order\":90,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":10,\"area_id\":8,\"name\":\"I can tell how I am likely to think, feel and behave in different situations.\",\"key\":\"sa10\",\"description\":\"Self Awareness - I can tell how I am likely to think, feel and behave in different situations.\",\"order\":100,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":11,\"area_id\":8,\"name\":\"I can tell when I have conflicting feelings and know how to cope with this.\",\"key\":\"sa11\",\"description\":\"Self Awareness - I can tell when I have conflicting feelings and know how to cope with this.\",\"order\":110,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":12,\"area_id\":8,\"name\":\"I can use my past experience to make wise choices to plan what to do with learning and relationships.\",\"key\":\"sa12\",\"description\":\"Self Awareness - I can use my past experience to make wise choices to plan what to do with learning and relationships.\",\"order\":120,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":13,\"area_id\":9,\"name\":\"I can express my feelings clearly and openly and appropriately in different situations.\",\"key\":\"mf13\",\"description\":\"Managing Feelings - I can express my feelings clearly and openly and appropriately in different situations.\",\"order\":10,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":14,\"area_id\":9,\"name\":\"I know that how I express my feelings makes a difference to other people and what happens to me.\",\"key\":\"mf14\",\"description\":\"Managing Feelings - I know that how I express my feelings makes a difference to other people and what happens to me.\",\"order\":20,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":15,\"area_id\":9,\"name\":\"I know some ways to manage strong feelings so that I do not hurt myself and other people.\",\"key\":\"mf15\",\"description\":\"Managing Feelings - I know some ways to manage strong feelings so that I do not hurt myself and other people.\",\"order\":30,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":16,\"area_id\":9,\"name\":\"I know what makes me feel good and how to help have a good time in ways that don\'t hurt myself or other people.\",\"key\":\"mf16\",\"description\":\"Managing Feelings - I know what makes me feel good and how to help have a good time in ways that don\'t hurt myself or other people.\",\"order\":40,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":17,\"area_id\":9,\"name\":\"I know that how I feel makes a difference to my health and know how to keep myself well and happy.\",\"key\":\"mf17\",\"description\":\"Managing Feelings - I know that how I feel makes a difference to my health and know how to keep myself well and happy.\",\"order\":50,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":18,\"area_id\":9,\"name\":\"I can reduce, manage or change strong and uncomfortable feelings such as anger, anxiety, stress and jealousy.\",\"key\":\"mf18\",\"description\":\"Managing Feelings - I can reduce, manage or change strong and uncomfortable feelings such as anger, anxiety, stress and jealousy.\",\"order\":60,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":19,\"area_id\":10,\"name\":\"I can set myself a goal or challenge and know when I have been successful.\",\"key\":\"mo19\",\"description\":\"Motivation - I can set myself a goal or challenge and know when I have been successful.\",\"order\":10,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":20,\"area_id\":10,\"name\":\"I can break a long-term plan into small steps.\",\"key\":\"mo20\",\"description\":\"Motivation - I can break a long-term plan into small steps.\",\"order\":20,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":21,\"area_id\":10,\"name\":\"I can anticipate and plan to work around or overcome potential obstacles.\",\"key\":\"mo21\",\"description\":\"Motivation - I can anticipate and plan to work around or overcome potential obstacles.\",\"order\":30,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":22,\"area_id\":10,\"name\":\"I can monitor and evaluate my own performance.\",\"key\":\"mo22\",\"description\":\"Motivation - I can monitor and evaluate my own performance.\",\"order\":40,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":23,\"area_id\":10,\"name\":\"I can work towards long-term goals and can wait for a reward.\",\"key\":\"mo23\",\"description\":\"Motivation - I can work towards long-term goals and can wait for a reward.\",\"order\":50,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":24,\"area_id\":10,\"name\":\"I know how to bring about change in myself and others.\",\"key\":\"mo24\",\"description\":\"Motivation - I know how to bring about change in myself and others.\",\"order\":60,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":25,\"area_id\":10,\"name\":\"I know that mistakes are a part of learning and can bounce back when I feel disappointed or have failed.\",\"key\":\"mo25\",\"description\":\"Motivation - I know that mistakes are a part of learning and can bounce back when I feel disappointed or have failed.\",\"order\":70,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":26,\"area_id\":10,\"name\":\"I can tell when my feelings are getting in the way of learning and know what to do about it.\",\"key\":\"mo26\",\"description\":\"Motivation - I can tell when my feelings are getting in the way of learning and know what to do about it.\",\"order\":80,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":27,\"area_id\":10,\"name\":\"I can attend well and can ignore distractions.\",\"key\":\"mo27\",\"description\":\"Motivation - I can attend well and can ignore distractions.\",\"order\":90,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":28,\"area_id\":10,\"name\":\"I can think about what I have done and learn from my mistakes.\",\"key\":\"mo28\",\"description\":\"Motivation - I can think about what I have done and learn from my mistakes.\",\"order\":100,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":29,\"area_id\":10,\"name\":\"I can stay optimistic and am positive when I try something new.\",\"key\":\"mo29\",\"description\":\"Motivation - I can stay optimistic and am positive when I try something new.\",\"order\":110,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":30,\"area_id\":10,\"name\":\"I can take responsibility for myself and my actions.\",\"key\":\"mo30\",\"description\":\"Motivation - I can take responsibility for myself and my actions.\",\"order\":120,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":31,\"area_id\":11,\"name\":\"I can tell how people are feeling.\",\"key\":\"em31\",\"description\":\"Empathy - I can tell how people are feeling.\",\"order\":10,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":32,\"area_id\":11,\"name\":\"I know that people express their feelings in different ways but that we all have feelings.\",\"key\":\"em32\",\"description\":\"Empathy - I know that people express their feelings in different ways but that we all have feelings.\",\"order\":20,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":33,\"area_id\":11,\"name\":\"I can tell what other people might be feeling or thinking.\",\"key\":\"em33\",\"description\":\"Empathy - I can tell what other people might be feeling or thinking.\",\"order\":30,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":34,\"area_id\":11,\"name\":\"I can listen to others and I can help them feel better if they are feeling worried or unhappy.\",\"key\":\"em34\",\"description\":\"Empathy - I can listen to others and I can help them feel better if they are feeling worried or unhappy.\",\"order\":40,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":35,\"area_id\":11,\"name\":\"I respect people from different cultures and backgrounds.\",\"key\":\"em35\",\"description\":\"Empathy - I respect people from different cultures and backgrounds.\",\"order\":50,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":36,\"area_id\":11,\"name\":\"I know the impact of bullying, prejudice and discrimination on others.\",\"key\":\"em36\",\"description\":\"Empathy - I know the impact of bullying, prejudice and discrimination on others.\",\"order\":60,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":37,\"area_id\":11,\"name\":\"I can support others with their problems.\",\"key\":\"em37\",\"description\":\"Empathy - I can support others with their problems.\",\"order\":70,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":38,\"area_id\":11,\"name\":\"I can feel empathy for others and do things to help.\",\"key\":\"em38\",\"description\":\"Empathy - I can feel empathy for others and do things to help.\",\"order\":80,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":39,\"area_id\":11,\"name\":\"I understand and accept that the feelings, beliefs and values of other people are important to them.\",\"key\":\"new\",\"description\":\"Empathy - I understand and accept that the feelings, beliefs and values of other people are important to them.\",\"order\":90,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":40,\"area_id\":11,\"name\":\"I can see the world from another person\\u2019s point of view\",\"key\":\"new\",\"description\":\"Empathy - I can see the world from another person\\u2019s point of view\",\"order\":100,\"created_at\":\"2019-03-01 17:54:24\",\"updated_at\":\"2019-03-01 17:54:24\"},{\"id\":41,\"area_id\":11,\"name\":\"I can work out how people are feeling through their words, body language, gestures and tone, and pay attention to them.\",\"key\":\"new\",\"description\":\"Empathy - I can work out how people are feeling through their words, body language, gestures and tone, and pay attention to them.\",\"order\"